function getQueryVariable(queryurl, variable) {
  if (queryurl.indexOf("?") > -1) {
    var query = queryurl.split("?")[1];
    var vars = query.split("&");
    for (var i = 0; i < vars.length; i++) {
      var pair = vars[i].split("=");
      if (pair[0] == variable) {
        return pair[1];
      }
    }
  } else {
    return "Uncategorized";
  }
}
